import React from "react";
import { useParams } from "react-router-dom";

function Detail(props) {
  const {cate} = useParams()
  
  return (
    <div>
      {props.list.map((item, id) => 
        <div key={id}>
          {item.name}{item.age}
        </div>
      )}
      {props.name}{props.age}
    </div>
  )
}
export default Detail;
